import React, { Component } from 'react';
import './code.css';
import path from './question.js'
import path1 from './template.js'
import path2 from './total.js'
import {LiveProvider, LiveEditor, LivePreview, LiveError} from 'react-live'
var chai = require('chai');
var assert = require("assert");


function getAnswer(ans){
    console.log(Object.is(ans,[-1,11]))
    // var testCase = document.getElementById('testCase')
    // testCase.value = chai.expect(ans).to.deep.equal([-1,11])
}

var start = ''
var end = ''
var code = false
function startCoding(){
    if (!code){
        start = Date.now()
        document.getElementById('wholeContent').style.visibility = 'visible'
        document.getElementById('startButton').style.visibility = 'hidden'
        document.getElementById('startButton').style.display = 'none'
        code = true
    }
    else if (code){
        end = Date.now()
        document.getElementById('wholeContent').style.visibility = 'hidden'
        document.getElementById('startButton').style.visibility = 'visible'
        document.getElementById('startButton').style.display = 'flex'
        var time = end - start
        var result = 'You took ' + parseInt(time/60) +' seconds!'
        document.getElementById('result').textContent = result
        code = false
    }
}

function parseFunction (str) {
    var fn_body_idx = str.indexOf('{'),
        fn_body = str.substring(fn_body_idx+1, str.lastIndexOf('}')),
        fn_declare = str.substring(0, fn_body_idx),
        fn_params = fn_declare.substring(fn_declare.indexOf('(')+1, fn_declare.lastIndexOf(')')),
        args = fn_params.split(',');

    args.push(fn_body);

    function Fn () {
      return Function.apply(this, args);
    }
    Fn.prototype = Function.prototype;

    return new Fn();
  }

function convertTemplate(){
    var func = parseFunction(document.getElementById('template').value)
    getAnswer(func([3,5,-4,8,11,1,-1,6],10))
}

class practiceCode extends Component {
    render(){
        const question = path
        const template = path1
        const total = path2
        return (
            <div>
                <div id='startButton' className='startButton'>
                    <button onClick={()=>startCoding()} >Start Coding</button><br/><br/>
                    <label id='result'>

                    </label>
                </div>
                <div id='wholeContent' className='wholeContent'>
                    <div className='code' id='code'>
                        <label className='questionText'>
                            {question}
                            <label id='testCase'>

                            </label>
                        </label>
                        <LiveProvider code={template} className='codeText'>
                            <LiveError/>
                        </LiveProvider>
                    </div>
                    <div className='submit' id='submit'>
                        <button onClick={()=>startCoding()} className='submit' id='submit'>Finish</button>
                        <button onClick={()=>convertTemplate()} className='submit' id='submit'>Run</button>
                        <label>{total}</label>
                    </div>
                </div>
            </div>
          );
        }
    }

export default practiceCode;
